import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
/* Components */
import Login from './componets/Login/Login';
import Registration from './componets/Registration/Registration';
class App extends Component {
  render() {

    return (
      <div className="app">
        <Login/>
        <Registration/>
      </div>
    );
  }

}
export default App;
